import logo from './logo.svg';
import './App.css';


function App() {
  return (
    <div className="App">
      <Navbar />
      <Hero />
      <About />
      <StatsCards />
      <GraphSection />
      <CTA />
      <ProgramBenefits />
      <FAQ />
      <Footer />
    </div>
  );
}

export default App;
